All metrics that your project collects must be defined in a metrics.yaml file. The format of that file is documented with glean_parser . To learn more, see adding new metrics . Important : as stated before , any new data collection requires documentation and data-review. This is also required for any new metric automatically collected by the Glean SDK. In order for the Glean SDK to generate an API for your metrics, two Gradle plugins must be included in your build: The Glean Gradle plugin JetBrains' Python envs plugin The Glean Gradle plugin is distributed through Mozilla's Maven, so we need to tell your build where to look for it by adding the following to the top of your build.gradle: buildscript { repositories { maven { url "https://maven.mozilla.org/maven2" } dependencies { classpath "org.mozilla.telemetry:glean-gradle-plugin:{latest-version}" } }
} Important: as above, the {latest-version} placeholder in the above link should be replaced with the version number of the Glean SDK used by the project. The JetBrains Python plugin is distributed in the Gradle plugin repository, so it can be included with: plugins { id "com.jetbrains.python.envs" version "0.0.26"
} Right before the end of the same file, we need to apply the Glean Gradle plugin: apply plugin: "org.mozilla.telemetry.glean-gradle-plugin" There are additional parameters that can be set to control the behavior of the Glean Gradle plugin, but they are rarely needed for normal use. Note: Earlier versions of Glean used a Gradle script (sdk_generator.gradle) rather than a Gradle plugin. Its use is deprecated and projects should be updated to use the Gradle plugin as described above. The metrics.yaml file is parsed at build time and Swift code is generated. Add a new metrics.yaml file to your Xcode project. Follow these steps to automatically run the parser at build time: Download the sdk_generator.sh script from the Glean repository: https://raw.githubusercontent.com/mozilla/glean/{latest-release}/glean-core/ios/sdk_generator.sh Important: as above, the {latest-version} placeholder should be replaced with the version number of Glean SDK release used in this project. Add the sdk_generator.sh file to your Xcode project. On your application targets' Build Phases settings tab, click the + icon and choose New Run Script Phase. Create a Run Script in which you specify your shell (ex: /bin/sh), add the following contents to the script area below the shell: bash $PWD/sdk_generator.sh Add the path to your metrics.yaml and (optionally) pings.yaml under "Input files": $(SRCROOT)/{project-name}/metrics.yaml
$(SRCROOT)/{project-name}/pings.yaml Add the paths to the generated code files to the "Output Files": $(SRCROOT)/{project-name}/Generated/{YourCategory}.swift Important : The parser generates one file per category. If you are unsure which files those are, skip this step and add the files after they are generated for the first time. If you are using Git, add the following line to your .gitignore file: {project-name}/Generated Important: The Python bindings are already being used internally for testing of Mozilla's data platform. However, they are not ready for production or inclusion in applications that are distributed to end users. Progress on this support is being tracked in this bug . For Python, the metrics.yaml file must be available and loaded at runtime. If your project is a script (i.e. just Python files in a directory), you can load the metrics.yaml using: from glean import load_metrics metrics = load_metrics("metrics.yaml") # Use a metric on the returned object
